		//--------------------------------------עצירה------------------------------------//
		function click_On_Pause() {
		
			var btnPause = stage.getChildByName("pause"); //משיכה של הכפתור מהבמה
			btnPause.removeEventListener("click", click_On_Pause); //יצירת מתנה הקלקה
			var diver = stage.getChildByName("diver"); //משיכה של הצוללן מהבמה
		
			//clearInterval(cancel);
			cjs.Ticker.paused = true; //הפסקת טיקר
			window.removeEventListener("keydown", handlekeypress); //הסרה של האפשרות של הצוללן לזוז
			btnPause.alpha = 1; //שקיפות של כפתור עצירה
			diver.visible = false; //הצוללן לא יראה על המסך
		
		
			//ריצה ככמות מערך השאלות
			for (k = 0; k < myGame.length; k++) {
				var floating = stage.getChildByName("floating" + k); //קבלת האובייקט הרלוונטי מהבמה
				if (floating != null) { //אם אלמנט קיים על הבמה
					var answer = stage.getChildByName("answer" + k); //קבלת האובייקט הרלוונטי מהבמה	
					floating.visible = false; //הסתרה של המצופים הנמצאים על הבמה
					if (answer != null) {
						if (answer.visible == true) {
							answer.visible = false;
						}
					}
		
		
				}
			}
		
			var pauseImg = new lib.pauseText(); //קבלת סימבול למשתנה
			pauseImg.name = "pauseImg"; //שם המשתנה
			pauseImg.x = stageMaxWidth / 2; //מיקום האובייקט על הבמה
			pauseImg.y = stageMaxheight / 2;
			stage.addChild(pauseImg);
		
			var pauseText = new lib.exitPause(); //קבלת סימבול למשתנה
			pauseText.name = "pauseTexT"; //שם המשתנה
			pauseText.x = stageMaxWidth - 640; //מיקום האובייקט על הבמה
			pauseText.y = stageMaxheight - 280;
			stage.addChild(pauseText); //הצגת האובייקט על הבמה
			pauseText.addEventListener("click", exit_Pause); //יצירת מתנה הקלקה
		}
		
		
		function exit_Pause() {
			var btnPause = stage.getChildByName("pause"); //משיכה של הכפתור מהבמה
			var diver = stage.getChildByName("diver"); //משיכה של הצוללן מהבמה	
		
			//setInterval(incrementSeconds, 1000);
			cjs.Ticker.paused = false; //המשך טיקר
			window.addEventListener("keydown", handlekeypress); //המשך תזוזה של צוללן
			btnPause.alpha = 0.3; //שקיפות של כפתור עצירה
			diver.visible = true; //הראה צוללן
		
			//ריצה ככמות מערך השאלות
			for (k = 0; k < myGame.length; k++) {
				var floating = stage.getChildByName("floating" + k); //קבלת האובייקט הרלוונטי מהבמה
				if (floating != null) { //אם אלמנט קיים על הבמה
					var answer = stage.getChildByName("answer" + k); //קבלת האובייקט הרלוונטי מהבמה	
					floating.visible = true; //החזר נקראות של האובייקט על הבמה
					if (answer != null) {
						if ((answer.visible == false) && floating.y <= (stageMaxheight - 300)) {
							answer.visible = false;
						} else {
							answer.visible = true;
						}
					}
		
				}
			}
			stage.removeChild(stage.getChildByName("pauseTexT")); //הסר את האובייקט של עצור
			stage.removeChild(stage.getChildByName("pauseImg"));
			btnPause.addEventListener("click", click_On_Pause); //יצירת מתנה הקלקה
		}
		
