		function handlekeypress(e) { //פונקציה השולטת על תזוזות הצוללן על הבמה
		
		
			var getDiver = stage.getChildByName("diver"); //קבלת האובייקט הרלוונטי מהבמה
		
		
			if (e.keyCode == 37) //פעולה במקרה של בחירת מקש שמאל
			{
		
				if (getDiver.scaleX < 0) {
					getDiver.scaleX = (-1) * (getDiver.scaleX);
				}
		
				if (getDiver.x > 50) // גבול שמאלי
				{
					getDiver.x -= movment; //כל עוד לא הגיע לגבול תתבצע תנועה שמאלה
				}
			}
			if (e.keyCode == 38) //פעולה במקרה של בחירת מקש מעלה
			{
		
				if (getDiver.y > 60) // גבול עליון
				{
					getDiver.y -= movment; //כל עוד לא הגיע לגבול העליון תבצע תנועה מעלה
				}
			}
			if (e.keyCode == 39) //פעולה במקרה של בחירת מקש ימינה
			{
				if (getDiver.scaleX > 0) {
					getDiver.scaleX = (-1) * (getDiver.scaleX);
				}
		
		
				if (getDiver.x < stageMaxWidth - 50) // גבול ימין
				{
					getDiver.x += movment; //כל עוד לא גיע לגבול הימני תבצע תנועה ימינה
				}
			}
			if (e.keyCode == 40) //פעולה במקרה של בחירת מקש מטה
			{
		
				if (getDiver.y < stageMaxheight - 350) // גבול מטה
				{
					getDiver.y += movment; //כל עוד לא הגיע לגבול מטה
				}
			}
		}
		
		function tick() {
			if (cjs.Ticker.paused == false) { //האם הטיק במצב עצור
		
		
				for (k = 0; k < myGame.length; k++) { //רוץ בגודל המסיחים של המשחק
					var floating = stage.getChildByName("floating" + k); //קבלת האובייקט הרלוונטי מהבמה
					var answer;
					if (floating != null) {
						//אם אלמנט קיים על הבמה
						if (randomRevelAnswer[k] >= floating.x) { // אם המצוף קטן או שווה למיקום שהוגרל לו בציר X
							floating.x++; //קדם את המצוף ב1
						} else { //אם המצוף נמצא מעל המספר שהוגרל לו בציר ה X
							floating.gotoAndStop(1);
							if ((typeof (myGame[k][0]) === "function")) {
								answer = stage.getChildByName("answer" + k); //קבלת האובייקט הרלוונטי מהבמה	
								floating.AnswerText.text = myGame[k][1];
								floating.AnswerTextTop.text = "";
								answer.x = floating.x + 55; //קדם את צורת המסיח בהתאם
								answer.y = floating.y + 45; //קדם את צורת המסיח בהתאם
								answer.visible = true; //הראה את המסיח
							} else {
								floating.AnswerText.text = "";
								floating.AnswerTextTop.text = myGame[k][1];
							}
							floating.y--; //תעלה את המצוף למעלה ב1
		
		
		
							var feedback; //משתנה למתן פידבק
							var correctOrNotCorrectQuestion = myGame[k][2];
							var progressBarUpdate = stage.getChildByName("target");
		
							if (intersect(floating, stage.getChildByName("diver"))) { //אם קיימת אינטרקיה בין הצוללן למצוף
								if (correctOrNotCorrectQuestion == true) { //אם התשובה נכונה
									answeredCorrect[k] = true; //תעדכן את המערך שהתשובה נענתה נכון
									//****************************
									mysound = createjs.Sound.play("correct");
									feedback = lib.great; //סימבול חיובי
									progressBarUpdate.x -= progressBarMovment;
		
								} else {
									//****************************
									mysound = createjs.Sound.play("incorrect");
									feedback = lib.tryAgain; //סימבול שלילי
									timeUserWrong++;
								}
								//עצירה של הטיקר , בדיקת מערכים , עידכון מערכים , החזרת טיקר, יצירת מצוף חדש
								TimeOut_And_Remove_Folating_From_Stage(floating, answer, feedback);
		
		
		
		
		
							}
		
							if (floating.y == 30) { //אם המצוף פוגע בחלקו העליון של המסך
								if (correctOrNotCorrectQuestion == false) { //אם התשובה נכונה
									answeredCorrect[k] = true; //תעדכן את המערך שהתשובה נענתה נכון
									//********************************
									mysound = createjs.Sound.play("correct");
									feedback = lib.great; //סימבול חיובי
									progressBarUpdate.x -= progressBarMovment;
								} else {
									//********************************
									mysound = createjs.Sound.play("incorrect");
									feedback = lib.tryAgain; //סימבול שלילי
									timeUserWrong++;
								}
								//עצירה של הטיקר , בדיקת מערכים , עידכון מערכים , החזרת טיקר, יצירת מצוף חדש
								TimeOut_And_Remove_Folating_From_Stage(floating, answer, feedback);
		
		
							}
		
						}
					}
		
				}
			}
		
		}
		//בודק אם קיימים ערכים שליליים במערך
		//מקבל מערך
		function check_Array_Game_Status(array) {
			//איפס של counter
			countFalse = 0;
			for (j = 0; j < array.length; j++) { //רוץ בגודל המסיחים של המשחק
				if (array[j] == false) { //אם קיים ערך שלילי
					countFalse += 1; //תוסיף 1 COUNTER
				}
			}
			if (countFalse > 0) { //אם גדול מ 0 תחזיר true
				return false;
			}
			return true; //תחזיר אמת אם כל הערכים של המערך הם ערכים חיוביים
		
		}
		//בודק אם יש מצוף שלא נמצא על הבמה ולא נענה נכון
		function verify_Floating_On_Stage_Equel_Are_All_AnsweredCorrect() {
			for (n = 0; n < myGame.length - 1; n++) { //ריצה על המערך 
				if (nowOnStage[n] == false && answeredCorrect[n] == false) { //אם לא נמצא על הבמה ולא נענה נכון
					return false; //תחזיר ערך שלילי
				}
		
			}
			return true; //אם נמצא על הבמה ונענה נכון תחזיר ערך חיובי
		}
		//עוצרת טיקר ומחזירה אותו לפעולה אחרי 2 שניות
		//מסירה את המצופים הרלוונטיים ,פידבקים ותמונה ומלל שעל המצוף
		//יוצרת מצוף חדש בקראיה לפונקציה בהתאם 
		//מקבלת מצוף,השאלה עצמה (טקסט ,תמונה) ,פידבק
		function TimeOut_And_Remove_Folating_From_Stage(floating, answer, feedback) {
			cjs.Ticker.paused = true; // עצור תנועה על המסך	
			window.removeEventListener("keydown", handlekeypress); //תסיר תזוזה של הצוללן
			var answerFeedback = new(feedback); //יוצרת פידבק
			answerFeedback.x = floating.x; //ממקמת אותו קרוב לתשובה
			answerFeedback.y = floating.y; //ממקמת אותו קרוב לתשובה
			stage.addChild(answerFeedback); //הצג על המסך פידבק
			var questionNumber;
			if (floating.name.charAt(9)) {
				questionNumber = floating.name.charAt(8); //מחזיק את המספר של המצוף בזוגי
				questionNumber += floating.name.charAt(9); //מחזיק את המספר של המצוף
			} else {
				questionNumber = floating.name.charAt(8); //מחזיק את המספר של המצוף
			}
			questionNumber = parseInt(questionNumber);
		
			nowOnStage[questionNumber] = false; //עדכן שהמצוף כבר לא על הבמה
		
			var btnPause = stage.getChildByName("pause");
			btnPause.removeEventListener("click", click_On_Pause); //יצירת מתנה הקלקה 
		
			//עצירה של 2 שניות
			setTimeout(function () {
		
		
				if ((typeof (myGame[questionNumber][0]) === "function")) {
					stage.removeChild(answer); //הסר תשובה על המצוף
				}
		
				stage.removeChild(answerFeedback); //הסר פידבק
		
				stage.removeChild(floating); //הסר מצוף
		
				//בודק אם המשחק הגיע לסיומו והכל נענה נכונה	
				if (check_Array_Game_Status(answeredCorrect)) {
					//סיים משחק והצג אנימציית סוף משחק
					game_Over();
				} else { //אם הכל עוד לא נענה נכונה
					if (allQuestionShowedFirstTimeOnstage == false) { //אם לא הוצגו כל השאלות כל הבמה לפחות פעם אחת
						create_Bubbles_On_Stage(Math.floor(Math.random() * 150) + 0); ///תיצור מצוף חדש
					}
					//אם כל המצופם הוצגו וקיימים מצופים שהם לא על הבמה ולא נענו נכונה תיצור מצוף חדש
					else {
						if (verify_Floating_On_Stage_Equel_Are_All_AnsweredCorrect() == false)
							create_Bubbles_On_Stage(Math.floor(Math.random() * 150) + 0); //תיצור מצוף חדש	
					}
				}
				window.addEventListener("keydown", handlekeypress); //תזוזה של הצוללן
				btnPause.addEventListener("click", click_On_Pause); //יצירת מתנה הקלקה
				cjs.Ticker.paused = false; // המשך תנועה על המסך
			}, 2000); // זמן במילי שניות
		}
		
		//מפגש בין שני אלמנטים
		function intersect(obj1, obj2) {
			var diverObj2W = 60;
			var diverObj2h = 30;
			//var bounyObj1W = 150;
			var bounyObj1H = 30;
			var obj1W = obj1.nominalBounds;
			var obj2W = obj2.nominalBounds;
		
		
			if ((obj1.x) + ((obj1W.width) / 2) <= obj2.x - ((obj2W.width) / 2)) {
				return false;
			} else if (obj1.y + ((obj1W.height - 30) / 2) <= obj2.y - ((obj2W.height + diverObj2h) / 2)) {
				return false;
			} else if ((obj1.x + 150) - ((obj1W.width) / 2) > obj2.x + ((obj2W.width) / 2)) {
				return false;
			} else if (obj1.y - ((obj1W.height + 30) / 2) > obj2.y + ((obj2W.height - diverObj2h) / 2)) {
				return false;
			}
			return true;
		}
		
		
		
